Office 2013-2016 C2R Install 6.3 - Install Microsoft Office Online

Office 2013 - 2016 C2R Install 6.3&#xA0;- online installation program Microsoft Office 2016 or Microsoft Office 2013 on your PC.&#xA0;

The advantage of the program is the ability to install individual components of the 2016 office, as well as the language of the installed office suite.&#xA0;

You can install the parts you like not have to download the full iso file, selected language installation and version number (32bit or 64bit), all you need is tick for the correct part. Let it download and install automatically.&#xA0;
Changes in version:
